import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Sectionthree from './Accordbs';
import Home from './home';
import About from './about';
import Navigation from './navbar';
import Service from './service';
function App() {
  return (
    <div className="App">
      <Navigation/>
      <Home/>
      <Service/>
      <Sectionthree/>
      <About/>
    </div>
  );
}

export default App;
